import React, {useState} from "react";


const CheckProductPageTemplate = () => {

    const [input, setInput] = useState('');
    const [temp, settemp] = useState([]);

    const fetchData = (value: string) => {
        const response = fetch('http://localhost:8000/api/products/get', {
            method: 'GET',
            headers: {'Content-Type': 'application/json'},
        }).then((response) => response.json())
        .then((json) => {
            const results = json.filter((product:any) => {
                return (
                    value &&
                    product &&
                    product.name &&
                    product.name.toLowerCase().includes(value)
                );
            });
            settemp(results);
        })

    };

    const handleChange = (value:string) =>{
        setInput(value);
        fetchData(value);
    };

    return (
        <div>
            <div>Sprawdz produkt</div>
            <div className="input-div-wrapper">
                <input
                    placeholder="Type to search..."
                    value={input}
                    onChange={(e) => handleChange(e.target.value)}
                />
            </div>
            <div>
        {results.map((product) => (
          <div key={product.id}>
            <p>Name: {product.name}</p>
            <p>Weight: {product.weight}</p>
            <p>Energy: {product.energy}</p>
            {/* Add more properties as needed */}
          </div>
        ))}
      </div>
        </div>
    );
}

export default CheckProductPageTemplate;
